The program below demonstrates a simple buffer overflow attack. The program takes an input from the user and stores it in a buffer. If the input is longer than the size of the buffer, the extra characters will overflow into adjacent memory areas. This can be used to overwrite other variables in the program or injected malicious code.

#include <stdio.h>
#include <string.h>

int main(int argc, char *argv[]) {
    char buf[10];
    if (argc != 2) {
        printf("usage: %s <input>\n", argv[0]);
        return 1;
    }
    strcpy(buf, argv[1]);
    printf("input was: %s\n", buf);
    return 0;
}

