#include <iostream>
#include <vector>
#include <string>

using namespace std;

class Computer
{
public:
    string name;
    vector<string> extensions;

    Computer(string name)
    {
        this->name = name;
    }

    void setExtensions(vector<string> extensions)
    {
        this->extensions = extensions;
    }
};

class Network
{
public:
    vector<Computer> computers;

    Computer& getComputer(string name)
    {
        for(int i=0;i<computers.size();i++)
        {
            if( computers[i].name == name )
                return computers[i];
        }
    }

    void addComputer(Computer comp)
    {
        computers.push_back(comp);
    }

    void setExtension(string computerName, vector<string> extensions)
    {
        Computer& comp = getComputer(computerName);
        comp.setExtensions(extensions);
    }
};

int main()
{
    Network nw;

    //creating 2 computers
    Computer c1("comp1"), c2("comp2");
    nw.addComputer(c1);
    nw.addComputer(c2);

    //setting extensions of computers
    vector<string> ext;
    ext.push_back("jpg");
    ext.push_back("png");
    ext.push_back("exe");
    nw.setExtension("comp1", ext);

    ext.clear();
    ext.push_back("html");
    ext.push_back("cpp");
    nw.setExtension("comp2", ext);

    //showing extensions of each computer
    Computer& comp1 = nw.getComputer("comp1");
    for(int i=0;i<comp1.extensions.size();i++)
        cout<<comp1.extensions[i]<<endl;

    Computer& comp2 = nw.getComputer("comp2");
    for(int i=0;i<comp2.extensions.size();i++)
        cout<<comp2.extensions[i]<<endl;

    return 0;
}

